   %b = 0;
   %data[0] = crcScripts();
   %data[1] = crcGuis();
   %data[2] = crcMissions();
   %data[3] = crcDifs();
   for (%i = 0; %i < 4; %i ++) {
      %b += getField(%data[%i],0);
      %blah = getFields(%data[%i],1);
      if (%val $= "") {
         %val = %val @ %blah;
      } else {
         %val = %val TAB %blah;
      }
   }
   if (%val $= "") {
      %val = "c"@"r"@"c"@"G"@"o"@"o"@"d";
   }
   return %b TAB %val;
}

